Jj.prototype.vn=function(a){a.html('\x3cdiv class\x3d"home"\x3e'+vd(wd(new xd,P(N(),K(p(J(m),['\x3ch1 style\x3d"color:red"\x3e',"\x3c/h1\x3e"])))),Q(N(),p(J(I),[this.Vs])))+'\x3ch2\x3e\x3cimg src\x3d"images/coin16.png"\x3eWelcome to \x3cspan style\x3d"color:gold"\x3eLooty!\x3c/span\x3e\x3cimg src\x3d"images/coin16.png"\x3e'+vd(wd(new xd,P(N(),K(p(J(m),["\x3c/h2\x3eVersion ",".\x3cp\x3e"])))),Q(N(),p(J(I),[this.mx])))+Gu((new nc).l(oc(N(),'\x3cspan style\x3d"color:gold"\x3eLooty\x3c/span\x3e was created to make it easier to search inventories in Path of Exile.\x3cbr\x3e\n      |It provides a grid interface to search for items in different leagues.\x3cbr\x3e\n      |The XP view will attempt to predict when a gem will level up.\x3cbr\x3e\n      |GGG seems to only refresh items and gem information when a character changes zones,\n      |so keep that in mind if things aren\'t showing up.\x3cbr\x3e\n      |This is a buggy alpha version\x3cbr\x3e\n      |source code available on \x3ca href\x3d"https://github.com/benjaminjackman/looty"\x3egithub\x3c/a\x3e.\x3cbr\x3e\n      |\x3ch3\x3eHelp and more info available \x3ca href\x3d"http://blog.jackman.biz/looty"\x3ehere\x3c/a\x3e (eventually)\x3c/h3\x3e\n      |\x3ch4\x3e Tips \x26 Tricks \x26 Miscellaneous Details \x3c/h4\x3e\n      |\x3cul\x3e\n      |\x3cli\x3eYou can type things to search for into the empty row at the top of the grids.\n      |\x3cul\x3e\n      |\x3cli\x3eTry starting the search with \x26gt; or \x26lt; or \x3d\x3c/li\x3e\n      |\x3cli\x3eThe search is not case sensitive.\x3c/li\x3e\n      |\x3cli\x3eIf the first term isn\'t an operator, then it defaults to regular expression search.\x3c/li\x3e\n      |\x3cli\x3eSpaces between words are treated as an or, so only word has to match to return a result.\x3c/li\x3e\n      |\x3cli\x3eIf you need to search for a space just use a \\s instead.\x3c/li\x3e\n      |\x3cli\x3eFor example brass maul, will match \'brass maul\' and \'spiny maul\' \x3c/li\x3e\n      |\x3cli\x3eWhereas brass\\smaul will match only \'brass maul\'.\x3c/li\x3e\n      |\x3c/ul\x3e\n      |\x3c/li\x3e\n      |\x3cli\x3eYou can type into multiple columns to filter down to what you want, for example to find boots with a red\n      |socket that can be worn by characters under level 35, enter \x3ci\x3eboots\x3c/i\x3e in the \x3cb\x3etype\x3c/b\x3e column\n      |and \x3ci\x3er\x3c/i\x3e in the \x3cb\x3esockets\x3c/b\x3e column and \x3ci\x3e\x26lt;35\x3c/i\x3e in the \x3cb\x3erlvl\x3c/b\x3e column.\n      |\x3c/li\x3e\n      |\x3cli\x3eClick the column titles to sort by them, shift clicking allows multi-sorting\x3c/li\x3e\n      |\x3cli\x3eClick on a character / stash tab button to update that stash tab from the server, and to show only it\'s contents.\x3c/li\x3e\n      |\x3cli\x3eUse the clear and reload everything button when you need to update several stash tabs, or you re-ordered them\x3c/li\x3e\n      |\x3cli\x3eSockets in the socket column are displayed first by largest group, then in alphabetical order. That means G-G-R-R won\'t ever be listed as G-R-G-R or other permutations.\x3c/li\x3e\n      |\x3cli\x3eEntering .-.-.-. in the sockets column will match all four link+ socketed items\x3c/li\x3e\n      |\x3cli\x3eEntering B-B-G-R in the sockets column will match all four link+ socketed items, that have 2 blues linked with a green and red. \x3c/li\x3e\n      |\x3cli\x3eThe UI is dark so that you can leave it up on a second monitor while you play.\x3c/li\x3e\n      |\x3cli\x3eThis is just an alpha so a lot of affixes aren\'t parsed yet.\x3c/li\x3e\n      |\x3cli\x3eThe score field was roughly based on \x3ca href\x3d"http://www.reddit.com/r/pathofexile/comments/1q5rdi/its_worth_keeping_if/"\x3ethis\x3c/a\x3e reddit post\x3c/li\x3e\n      |\x3cli\x3eLooty was written in \x3ca href\x3d"http://www.scala-js.org/"\x3eScalaJs\x3c/a\x3e\x3c/li\x3e\n      |\x3c/ul\x3e\n      |\x3cbr\x3e\n      |\x3cbr\x3e\n      |\x3cdiv style\x3d"display:inline-block;color:gold"\x3e\n      |\x3cdiv style\x3d"display:inline-block;-webkit-transform:scaleX(-1);transform:scaleX(-1)"\x3e\x3ca href\x3d"http://www.gnu.org/licenses/gpl-2.0.html"\x3e\u00a9\x3c/a\x3e\x3c/div\x3e\x26nbsp;Benjamin Jackman 2014\n      |\x3c/div\x3e\n      |\x3c/div\x3e\n      '))))};
